  \"Towards Modeling the Effects of Lightning Injection on Power MOSFETs\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:03:48.340347\",\n\t\"name\": \"towards-modeling-the-effects-of-lightning-injection-on-power-mosfets\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Power electronics are widely used in critical
  roles in modern day aircrafts and hence their health management is of great interest.
  An important part of prognostics and health management of these devices is understand-
  ing the effect of high-stress events such as lightning and how they affect their
  aging. In this paper we present our study and analysis of lightning injection experiments
  with power MOSFETs in their ON state. We show the different kind of damages that
  can be caused by such events and analyze their effects on device performance parameters.
  In addition, we present a simple yet effec- tive modeling technique that can model
  the degradation in these devices. Such models will play a valuable role in understanding
  the behavior of these damaged devices when operated under normal conditions later
  and sub- sequently in prognosis of their remaining useful life.We present our results
  on the performance of this modeling and the scope within which they can be utilized
  for ac- curate estimation of device damage.\",\n\t\"license_title\": \"U.S. Government
